import { Button } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'

function Nav() {
  return (
    <div className='parentNav'>
        <div className='divBtn'><Link to='/SignUp' className='text_deco'><button type='submit' className='btn'>Create Account</button></Link></div>
        <div className='divBtn'><Link to='/Login' className='text_deco'><button type='submit' className='btn'>Check Apointment</button></Link></div>
    </div>
  )
}

export default Nav
